import React from 'react'
import { connect } from 'react-redux';
import {toggleSubMenu} from '../../redux/menu/menu-action'



export const SubNav=({Title,Link,Items,toggleSubMenu})=>
(

        <div>
            <h3>{Title}</h3>

        {Items.map(subItem=>(<li>{subItem.Title}</li> ))


             


        }

        </div>

)

const mapDispatchToProps = (dispatch) => ({

    toggleSubMenu:()=>dispatch(toggleSubMenu())
  });

export default connect(null,mapDispatchToProps) (SubNav)
